import './App.css';
import Appbar from "./components/Appbar";
import Person from "./components/Person";

import heart from "./img/heart.png"

function App() {
  return (
    <div style={{backgroundImage:`url(${heart})`, backgroundRepeat:"no-repeat"}} className="App">
    <Appbar/>
    <Person/>
    </div>
  );
}

export default App;
